import React ,{ Component} from 'react';



class Header extends Component {
    render(){
        return(
            <div className="main-header">
                <div className="logo-header">
                    <hr/> <h3>SmartHome</h3><hr/>
                </div>

            </div>
        );
    }
}



export default Header
